// src/components/Register.js
import React, { useState } from 'react';
import axios from 'axios';
import './Register.css';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  // State to manage the form data
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    description: '',
    password: '',
    profilePicture: null,
  });

  // Hook for navigation after registration
  const navigate = useNavigate();

  // Function to handle changes in text inputs and textarea
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value, // Dynamically update form data based on the input field's name
    });
  };

  // Function to handle changes in the file input
  const handleFileChange = (e) => {
    setFormData({
      ...formData,
      profilePicture: e.target.files[0], // Set the selected file as profilePicture
    });
  };

  // Function to handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault(); // Prevent the default form submission behavior

    // Create a new FormData object to include form fields and the file
    const formDataWithImage = new FormData();
    formDataWithImage.append('name', formData.name);
    formDataWithImage.append('email', formData.email);
    formDataWithImage.append('description', formData.description);
    formDataWithImage.append('password', formData.password);
    if (formData.profilePicture) {
      formDataWithImage.append('profilePicture', formData.profilePicture); // Only append the file if it exists
    }

    try {
      // Send the form data to the backend via a POST request
      await axios.post('http://localhost:5000/register', formDataWithImage);

      // If successful, navigate to the login page
      navigate('/login');
    } catch (error) {
      // Error handling with detailed comments
      if (error.response) {
        // The request was made and the server responded with a status code
        // that falls out of the range of 2xx (successful responses)
        console.error('Error response data:', error.response.data); // Log the error response data from the server
        console.error('Error response status:', error.response.status); // Log the status code (e.g., 400, 500)
        console.error('Error response headers:', error.response.headers); // Log the headers of the response
      } else if (error.request) {
        // The request was made but no response was received
        // `error.request` is an instance of XMLHttpRequest in the browser
        console.error('Error request:', error.request); // Log the request object that was sent
      } else {
        // Something happened in setting up the request that triggered an Error
        console.error('Error message:', error.message); // Log the error message
      }
      console.error('Error config:', error.config); // Log the configuration that was used to make the request

      // Optionally, you can add more user-friendly error handling here
      // For example, you could show an error message to the user
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Register</h2>
      <form onSubmit={handleSubmit} style={styles.form}>
        {/* Input for the user's name */}
        <input
          type="text"
          name="name"
          placeholder="Name"
          value={formData.name}
          onChange={handleChange}
          style={styles.input}
          required // Make this field required
        />
        {/* Input for the user's email */}
        <input
          type="email"
          name="email"
          placeholder="Email"
          value={formData.email}
          onChange={handleChange}
          style={styles.input}
          required // Make this field required
        />
        {/* Textarea for a short description of the user */}
        <textarea
          name="description"
          placeholder="Short description"
          value={formData.description}
          onChange={handleChange}
          style={styles.textarea}
          required // Make this field required
        />
        {/* Input for the user's password */}
        <input
          type="password"
          name="password"
          placeholder="Password"
          value={formData.password}
          onChange={handleChange}
          style={styles.input}
          required // Make this field required
        />
        {/* Input for the user's profile picture */}
        <input
          type="file"
          name="profilePicture"
          onChange={handleFileChange}
          style={styles.fileInput}
          required // Make this field required
        />
        {/* Submit button */}
        <button type="submit" style={styles.button}>Register</button>
      </form>
      <p style={styles.login}>
        {/* Link to the login page if the user already has an account */}
        Or already have an account? <button style={styles.loginButton} onClick={() => navigate('/login')}>Login here</button>
      </p>
    </div>
  );
};

// Inline styles for the component
const styles = {
  container: {
    backgroundColor: '#f9f9f9',
    padding: '40px',
    borderRadius: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    width: '100%',
    maxWidth: '500px',
    margin: '20px auto',
    fontFamily: 'Arial, sans-serif',
  },
  title: {
    fontSize: '36px',
    color: '#004080',
    textAlign: 'center',
    marginBottom: '10px',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
  },
  input: {
    marginBottom: '20px',
    padding: '10px',
    fontSize: '16px',
    border: '1px solid #ccc',
    borderRadius: '5px',
  },
  textarea: {
    marginBottom: '20px',
    padding: '10px',
    fontSize: '16px',
    border: '1px solid #ccc',
    borderRadius: '5px',
  },
  fileInput: {
    marginBottom: '20px',
    padding: '10px',
    fontSize: '16px',
  },
  button: {
    backgroundColor: '#004080',
    color: 'white',
    border: 'none',
    padding: '15px',
    fontSize: '18px',
    cursor: 'pointer',
    transition: 'background-color 0.3s',
    borderRadius: '5px',
  },
  login: {
    marginTop: '20px',
    textAlign: 'center',
    fontSize: '16px',
  },
  loginButton: {
    background: 'none',
    border: 'none',
    color: '#004080',
    cursor: 'pointer',
    textDecoration: 'underline',
    fontSize: '16px',
  },
};

export default Register;
